INSERT INTO `courses_course` VALUES (2,'arabic','\"Welcome to our Arabic Language Learning Journey!\r\n\r\nJoin us in our Arabic language group, where we\'ll explore the beauty of the Arabic language and learn how to speak and write with confidence.\r\n\r\nIn this group, we\'ll offer:\r\n\r\nInteractive and engaging lessons for all age groups.\r\nCustomized educational programs to achieve each student\'s goals.\r\nPractical activities and applications to enhance language skills.\r\nSupport and encouragement from teachers and participants.\r\n\r\nJoin us now, and be part of our Arabic language learning journey!\r\n\r\nGroup Features:\r\n\r\nQualified and experienced teachers.\r\nLessons tailored for all age groups.\r\nPractical activities and applications.\r\nSupport and encouragement from members.\r\n\r\nWhat are you waiting for? Join now','courses/1000197159.jpg',NULL,5,15),(3,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,3,5),(4,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,5,4),(5,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,3,6),(6,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,3,12),(7,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,3,16),(8,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,3,13),(9,'English','Improve your English with nabbiuwny','defaults/default.jpg',NULL,3,14),(10,'arabic','Learn the Arabic language smoothly, grammar, rhetoric and correct pronunciation, and enjoy with the experts of the nabbiuwny platform .','defaults/default.jpg',NULL,3,16),(11,'Math','\"Welcome to the world of mathematics!\r\n\r\nMathematics is not just numbers and calculations, it\'s a language of understanding and exploration. It\'s a powerful tool that helps us make sense of the world around us, from the movement of planets to the behavior of molecules.\r\n\r\nIn this lesson, we\'ll explore exciting mathematical concepts together, and apply them to real-world challenges. We\'ll use logic and critical thinking to analyze problems, and find creative solutions.\r\n\r\nJoin us on a thrilling mathematical journey, where we\'ll discover together how math can change the way we think and enhance our understanding of the world.\r\n\r\nWhat are you waiting for? Join us now!\"','defaults/default.jpg',NULL,3,16),(12,'Islamic education','Welcome to our Islamic Education Learning Journey!\r\n\r\nJoin us in our Islamic Education groups, where we\'ll explore Islamic values and morals and learn how to apply them in our daily lives.\r\n\r\nIn this group, we\'ll offer:\r\n\r\nInteractive and engaging lessons in Islamic Creed, Morals, and Jurisprudence.\r\nPractical activities and applications to enhance Islamic understanding.\r\nOpportunities to interact with group members and share ideas.\r\nSupport and encouragement from teachers and participants.\r\n\r\nJoin us now, and be part of our Islamic Education learning journey!\r\n\r\nGroup Features:\r\n\r\nQualified and experienced teachers.\r\nLessons tailored for all age groups.\r\nPractical activities and applications.\r\nSupport and encouragement from members.\r\n\r\nWhat are you waiting for? Join us now!','defaults/default.jpg',NULL,3,16),(13,'arabic','\"Welcome to our Arabic Language Learning Journey!\r\n\r\nJoin us in our Arabic language group, where we\'ll explore the beauty of the Arabic language and learn how to speak and write with confidence.\r\n\r\nIn this group, we\'ll offer:\r\n\r\nInteractive and engaging lessons for all age groups.\r\nCustomized educational programs to achieve each student\'s goals.\r\nPractical activities and applications to enhance language skills.\r\nSupport and encouragement from teachers and participants.\r\n\r\nJoin us now, and be part of our Arabic language learning journey!\r\n\r\nGroup Features:\r\n\r\nQualified and experienced teachers.\r\nLessons tailored for all age groups.\r\nPractical 